export default function checkWorker() {
  if ('serviceWorker' in navigator) {
    window.addEventListener('load', function () {
      navigator.serviceWorker.register('service-worker-push.js').then(function (registration) {
        console.log('Worker registration is successful', registration);
        return registration;
      }, function (err) {
        console.log('Worker registration has failed', err);
        return false
      }).catch(function (err) {
        console.log(err);
        return false
      });
    });
  } else {
    console.log('Service Worker is not supported by your browser.');
    return false
  }
}
